import{_ as e,c as a,o as i,a as s}from"./app.9012fd6b.js";var r="/dokuveebmarit/assets/kassiref1.c5a7293c.png",t="/dokuveebmarit/assets/kassiref2.852e35df.png",n="/dokuveebmarit/assets/kassiref3.6bd49c9e.png",d="/dokuveebmarit/assets/kassiref4.21d37ba1.png",o="/dokuveebmarit/assets/kassiref5.ccaa8542.png",g="/dokuveebmarit/assets/kassiref6.bc852415.png",l="/dokuveebmarit/assets/kassiref7.c1b1b658.png",u="/dokuveebmarit/assets/kassiref8.a11c3382.png",k="/dokuveebmarit/assets/kassisona1.97c5c2a8.png",m="/dokuveebmarit/assets/kassisona2.bfb95827.png",p="/dokuveebmarit/assets/kassisona3.4864dc78.png",h="/dokuveebmarit/assets/kassisona4.5719b946.png",v="/dokuveebmarit/assets/referents_hunt.c7e7fdd6.png",b="/dokuveebmarit/assets/porg.bc1b1e47.jpg",j="/dokuveebmarit/assets/gaminglogoref.7dcc34e9.png",f="/dokuveebmarit/assets/gaminglogo.151fa5b8.png",c="/dokuveebmarit/assets/aries1.2ccaf33f.png",_="/dokuveebmarit/assets/aries2.cd9bd0fe.png",w="/dokuveebmarit/assets/aries3.303153cb.png",K="/dokuveebmarit/assets/aries4.f69c2c4c.png",S="/dokuveebmarit/assets/ariesdone.b6caacef.png";const C='{"title":"Tunniteema - kassi ja hundi referentside logod ning vapp","description":"","frontmatter":{},"headers":[{"level":2,"title":"Kass referentsi j\xE4rgi","slug":"kass-referentsi-jargi"},{"level":3,"title":"Kassiga s\xF5na tegemine","slug":"kassiga-sona-tegemine"},{"level":2,"title":"Hunt referentsi j\xE4rgi","slug":"hunt-referentsi-jargi"},{"level":3,"title":"Teised t\xF6\xF6d referentsi j\xE4rgi","slug":"teised-tood-referentsi-jargi"}],"relativePath":"logi/04_referents2.md","lastUpdated":1645646617275}',T={},q=s('<h1 id="tunniteema-kassi-ja-hundi-referentside-logod-ning-vapp" tabindex="-1">Tunniteema - kassi ja hundi referentside logod ning vapp <a class="header-anchor" href="#tunniteema-kassi-ja-hundi-referentside-logod-ning-vapp" aria-hidden="true">#</a></h1><p><br><br></p><h2 id="kass-referentsi-jargi" tabindex="-1">Kass referentsi j\xE4rgi <a class="header-anchor" href="#kass-referentsi-jargi" aria-hidden="true">#</a></h2><img src="'+r+'" alt="Kass referentsi j\xE4rgi 1" width="400"><br> Alguses tegin kassi j\xE4rgi geomeetrilised kujundid - ringid, ristk\xFClikud. <br><img src="'+t+'" alt="Kass referentsi j\xE4rgi 2" width="400"><br> Siis eemaldasin ebavajaliku osa kassi kehast kasutades pathfinderit, et j\xE4\xE4ks ta saba. Sellega oli natuke raskusi ja pidin mitu korda seda tegema, enne kui l\xF5puks hakkama sain. Alles praegu m\xE4rkasin, et ta suu kadus \xE4ra vahepeal kuskile. <br><img src="'+n+'" alt="Kass referentsi j\xE4rgi 3" width="400"><br> J\xE4rgmises etapis p\xF6\xF6rasin kassi nii, et ta n\xE4gu oleks horisontaalselt ekraani suunas. Tegin ta pea ja k\xF5rvad musta v\xE4rvi, pehmendasin nina pikema osa nurkasid ning lisasin juurde musta nina ringide abil. <br><img src="'+d+'" alt="Kass referentsi j\xE4rgi 4" width="400"><br> Seej\xE4rel pehmendasin k\xF5rvad ja silmade kaks nurka, mis on omavahel horisontaalselt. Lisasin k\xF5rvadele ka valge v\xE4rvi. <br><img src="'+o+'" alt="Kass referentsi j\xE4rgi 5" width="400"><br> P\xE4rast seda lisasin kassile pupillid ja v\xE4rvisin keha mustaks ja \xE4\xE4rejooned valgeks. M\xE4rkasin, et tegin pathfinderiga valesti saba osa ning pidin uuesti tegema. V\xF5tsin esimesest etapist keha ja tegin uuesti mitu korda, kuni l\xF5puks v\xE4lja tuli. <br><img src="'+g+'" alt="Kass referentsi j\xE4rgi 6" width="400"><br> V\xE4rvisin keha t\xE4iesti mustaks, ka \xE4\xE4rejooned. <br><img src="'+l+'" alt="Kass referentsi j\xE4rgi 7" width="400"><br> Pehmendasin saba otsa nurki ja lisasin uuesti valged \xE4\xE4rejooned, ka n\xE4ole. Viisin pea natuke l\xE4hemale kehale. <br><img src="'+u+'" alt="Kass referentsi j\xE4rgi 8" width="400"><br> Muutsin natuke k\xF5rvu, peamiselt pehmendasin valgete osade nurgad. <br><h3 id="kassiga-sona-tegemine" tabindex="-1">Kassiga s\xF5na tegemine <a class="header-anchor" href="#kassiga-sona-tegemine" aria-hidden="true">#</a></h3><p><br><br></p><img src="'+k+'" alt="Kass referentsi j\xE4rgi s\xF5na 1" width="400"><p>Kasutasin kassi kui &quot;B&quot; t\xE4hena. P\xF6\xF6rasin kassi oma originaalsesse suunda, liigutasin saba ta kehale l\xE4hemale. Valisin sobiva fondi ja natukene muutsin kerningut.</p><img src="'+m+'" alt="Kass referentsi j\xE4rgi s\xF5na 2" width="400"><p>Seej\xE4rel kasutates direct selection tooli t\xF5mbasin t\xE4htedelt &quot;A&quot; ja &quot;Y&quot; otsad pikemaks. Lisasin neile valge \xE4\xE4rejoone ja t\xF5mbasin k\xE4sitsi kokkupoole, nii, et &quot;A&quot; on k\xF5ige ees ja &quot;Y&quot; k\xF5ige taga.</p><img src="'+p+'" alt="Kass referentsi j\xE4rgi s\xF5na 3" width="400"><p>J\xE4rgmisena p\xF6\xF6rasin kassi peegelpilti ja t\xF5mbasin t\xE4htedele l\xE4hemale. T\xE4hed t\xF5mbasin ka veel l\xE4hemale \xFCksteisele.</p><img src="'+h+'" alt="Kass referentsi j\xE4rgi s\xF5na 4" width="400"><p>L\xF5puks p\xF6\xF6rasin kassi pea natukene viltu ja see j\xE4i mu l\xF5pptulemuseks.</p><h2 id="hunt-referentsi-jargi" tabindex="-1">Hunt referentsi j\xE4rgi <a class="header-anchor" href="#hunt-referentsi-jargi" aria-hidden="true">#</a></h2><p>Hunt tuli v\xE4lja natukene nagu p\xF5rsas minu v\xE4rvivaliku t\xF5ttu, aga muidu l\xE4ks mul isegi h\xE4sti sellega. Algul tegin pen tooliga musta osa. Seej\xE4rel tegin roosa osa, siis valged ja mustad osad peale. See ei olnud kuigi raske, aga tempo oli kiire, niiet ei saanud eriti ilusasti teha. <br> Uus asi, mis \xF5ppisin oli see, kuidas varjusid ja heledamaid kohti lisada. Pen tooliga teha see osa ja v\xF5ib \xFCle\xE4\xE4re minna, ning siis valida m\xF5lemad pen tooliga tehtud osa kui ka roosa osa ja siis alt klahviga vajutades ja shape builder tooliga kustutada \xFCleliigne osa. <br><br><img src="'+v+'" alt="Hunt referentsi j\xE4rgi" width="400"><br></p><h3 id="teised-tood-referentsi-jargi" tabindex="-1">Teised t\xF6\xF6d referentsi j\xE4rgi <a class="header-anchor" href="#teised-tood-referentsi-jargi" aria-hidden="true">#</a></h3><p>Mulle hakkas meeldima see teema ning tegin kodus ise veel kaks t\xF6\xF6d referentsi j\xE4rgi. <br><img src="'+b+'" alt="Porg referentsi j\xE4rgi" width="400"> <br> Tegin gaming logo enda tuttavale internetist tuletatud pildiga. <br><img src="'+j+'" alt="Gaming logo referentsi j\xE4rgi" width="400"><br><img src="'+f+'" alt="Gaming logo referentsi j\xE4rgi" width="400"> <br> Tegin enda t\xE4htkuju (j\xE4\xE4r) inspiratsioonil logo internetist tuletatud pildiga. <img src="'+c+'" alt="Sodiaagim\xE4rk referentsi j\xE4rgi" width="400"><img src="'+_+'" alt="Sodiaagim\xE4rk referentsi j\xE4rgi" width="400"><img src="'+w+'" alt="Sodiaagim\xE4rk referentsi j\xE4rgi" width="400"><img src="'+K+'" alt="Sodiaagim\xE4rk referentsi j\xE4rgi" width="400"><img src="'+S+'" alt="Sodiaagim\xE4rk referentsi j\xE4rgi" width="400"></p>',49),x=[q];function A(P,V,H,$,B,L){return i(),a("div",null,x)}var D=e(T,[["render",A]]);export{C as __pageData,D as default};
